function LoadUI(e){var t=document.getElementById("root"),o="";switch(e){case"home":o=(new home).render();break;case"about":o=about();break;case"contact":o=contact();break;default:o=NotFound()}t.innerHTML=o}class home{render(){return"<h1>Welcome Home</h1>"}}function contact(){return"<h1>Contact Us Here!</h1>"}function about(){return"<h1>About Us!</h1>"}function NotFound(){return"<h1>Not Found!</h1>"}